  false,\n\t\"url\": null,\n\t\"notes\": \"The Integrated Science Data Management
  (ISDM) office processes oceanographic profiles reported for the world oceans in
  near real-time from the Global Telecommunications System (GTS) for the Global Temperature
  and Salinity Profile Program (GTSPP). These data also support the activities of
  the Ship of Opportunity Programme Implementation Panel (SOOPIP) and the WOCE Upper
  Ocean Thermal Program (WOCE UOT). The ISDM sends a copy of these data to the US
  NODC three times each week.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
